INSERT INTO `advisingApp_courses` VALUES ('Additional Science','Computer Science','Aditional Labratory Science','D-',4,'CS-Major','Choose from CHEM 1510, PBIO 1140, PHYS 2051'),('AVN1000','Aviation and Flight','Introduction to Aviation','D',3,'Aviation-Major','Survey of civil aviation. Overview of aviation history, general aviation, types of air carrier aircraft, and the importance of the air transportation industry. Develops understanding of an airline flight from takeoff to landing.'),('AVN1100-AVN','Aviation and Flight','Private Pilot Ground School','D',3,'Aviation-Major','FAA mandated ground instruction covering radio navigation, meteorology, FAA regulations, communications, aircraft construction, and performance data to meet requirements of Private Pilot-Airplane Knowledge Test.'),('AVN2400','Aviation and Flight','Private Pilot Flight Course','D',3,'Aviation-Major','Meets FAA mandated requirements for Private Pilot Certificate. \r\n\r\nRequisites: Permission required'),('AVN3000','Aviation and Flight','Aviation Laws and Regulations','D',3,'Aviation-Major','Student obtains knowledge, background, and understanding of aviation laws and regulations. Emphasis is placed upon areas of legal concepts of operation, contracts, insurance and liability, regulatory statutes, and case law. In addition, various regulations of FAA, DOT, NTSB, and ICAO will be covered. \r\n\r\nRequisites: AVN 1000 and 1100'),('AVN3050','Aviation and Flight','Aviation Weather','D',3,'Aviation-Major','Identification of aviation weather hazards that affect pilots, dispatchers, and airport and airline management; familiarization with aviation weather products and providers; and application of weather interpretation to flight scenarios. \r\n\r\nRequisites: AVN 1100 and GEOG 3020'),('AVN3060','Aviation and Flight','National Airspace System','D',4,'Aviation-Major','Air Traffic Control (ATC) Procedures used to separate aircraft, flow control, ATC phraseology, and navigation in the National Airspace System (NAS).'),('AVN3100','Aviation and Flight','Instrument Pilot Ground School','D',3,'Aviation-Major','FAA mandated ground instruction covering various navigation systems and procedures, aircraft radios and communications, instrument flying, and air traffic control procedures. Includes functions of ATC centers, approach control, towers, and flight service stations. FAA regulations included. Meets all requirements for FAA Instrument Pilot Airplane Knowledge Test. \r\n\r\nRequisites: AVN 1100'),('AVN3150','Aviation and Flight','Aviation Safety','D',3,'Aviation-Major','Overview of aviation safety from management and pilot perspectives, including fundamental aviation safety concepts, risk theory and management, safety terms, prevention methodology, effective safety program organization, human factors, inspection programs, data and analytical information systems, and regulatory requirements. \r\n\r\nRequisites: AVN 1100'),('AVN3400','Aviation and Flight','Cross-Country Flight','D',3,'Aviation-Major','Flight training consisting of VFR cross-country flights and basic attitude instrument flying. \r\n\r\nRequisites: Permission required'),('AVN3500','Aviation and Flight','Commercial Pilot School','D',3,'Aviation-Major','FAA mandated ground instruction covering advanced aerodynamics, radio navigation, FAA regulations, aircraft construction and performance, theories of flight, weight and balance, and instruments to meet requirements of Commercial Pilot Airplane Knowledge Test. \r\n\r\nRequisites: AVN 1100 and 3100'),('AVN3600','Aviation and Flight','National Airspace System','D',4,'Aviation-Major','Air Traffic Control (ATC) Procedures used to separate aircraft, flow control, ATC phraseology, and navigation in the National Airspace System (NAS).'),('AVN3700','Aviation and Flight','Aircraft Systems and Powerplants','D',4,'Aviation-Major','In-depth study of simple and complex aircraft powerplants, fuel, electrical, hydraulic, and environmental systems.\r\n\r\nRequisites: AVN 3500'),('AVN3800','Aviation and Flight','General Aviation Operations and Management','D',3,'Aviation-Major','A study of General Aviation including FBO’s , marketing, sales, and management techniques. Marketing and management concepts applicable to FBO’s and other general aviation enterprises are studied. Travel analysis is performed to determine the need for a business aircraft.\r\n\r\nRequisites: AVN 1000 and 1100 and MGT 2000 and (Jr or Sr)'),('AVN3900','Aviation and Flight','Airline Operations and Management','D',3,'Aviation-Major','To give a broad understanding of the air transportation industry and the major management functions with an airline. Topics cover economics of airlines, managerial aspects, international aviation, and career planning. \r\n\r\nRequisites: AVN 1000 and 1100 and (MGT 2000 or MGT 2100) and (Jr or Sr)'),('AVN4000','Aviation and Flight','Instrument Flight Course','D',3,'Aviation-Major','Instruction in flight by sole reference to instruments. Preparation for instrument rating. \r\n\r\nRequisites: Permission required'),('AVN4050','Aviation and Flight','Advanced Cross Country and Flight','D',6,'Aviation-Major','Dual and solo Visual and Instrument cross country flight. \r\n\r\nRequisites: AVN 4000'),('AVN4200','Aviation and Flight','Commercial Flight','D',2,'Aviation-Major','Flight instruction in single engine complex airplane. Preparation for Commercial Pilot Certificate ASEL. \r\n\r\nRequisites: AVN 4050'),('AVN4300','Aviation and Flight','Multi-Engine Flight Course','D',2,'Aviation-Major','FAA mandated instruction to meet FAA Practical Test Standards (PTS) for certification as Commercial Pilot AMEL. Procedures will include, but are not limited to; those with both engines operative, with 1 engine inoperative (feathered), single-engine speeds, effects of airplane configuration on engine-out performance, en route operations, and single-engine approaches and landings. \r\n\r\nRequisites: Commercial pilot certificate'),('AVN4400','Aviation and Flight','Flight instructor Ground School','D',3,'Aviation-Major','FAA mandated ground instruction on FAA regulations and publications, weather, advanced flight computer operations, radio navigation, advanced aircraft and engine performance, and fundamentals of instructing. Covers requirements for FAA Fundamentals of Instructing Knowledge Test and Flight Instructor Airplane Knowledge Test. \r\n\r\nRequisites: AVN 3500'),('AVN4450','Aviation and Flight','Flight Instructor Flight Course','D',3,'Aviation-Major','FAA mandated ground and flight instruction with emphasis on how to instruct, analysis of maneuvers and flight from right seat. \r\n\r\nRequisites: Commercial pilot certificate and FAA fundamentals of instructing and flight instructor airplane knowledge tests passed'),('AVN4550','Aviation and Flight','Instrument Instructor Flight COurse','D',2,'Aviation-Major','Review of instrument course with emphasis on how to instruct on instruments. \r\n\r\nRequisites: Flight Instructor Certificate'),('AVN4750','Aviation and Flight','Internship in Aviation Operations','P',2,'Aviation-Major','Internship program in selected fields of aviation under direction of faculty member. \r\n\r\nRequisites: Permission required of department chair\r\nCredit Hours: 2.0-16.0'),('AVN4800','Aviation and Flight','Business in Aviation','D',3,'Aviation-Capstone','This capstone is a study of business aviation operations, management and finance to include corporate, fractional, charter, Fixed Base Operator (FBO), and various aviation business models. Students will apply research methods to actual cases from business partners and function as aviation business consultants. The result will require a synthesis of ideas and suggested solutions presented to the business partners.\r\n\r\nRequisites: AVN 3900 and (MGT 2000 or MGT 2100) and Sr only'),('AVN4850','Aviation and Flight','Advanced Aircraft and Flight Crew Operations','D',3,'Aviation-Major','Introduction to advanced flight crew concepts and procedures with emphasis on professional pilot development, safety standardization, and crew resource management (CRM) techniques. The practical portion includes simulated industry-oriented flight training (air carrier instrument approach procedures, interview and training/qualification simulator profiles, and line-oriented Flight Training – LOFT). Includes lectures and simulator instruction in Simulator/FTD. \r\n\r\nRequisites: AVN 4300'),('AVN4890','Aviation and Flight','Transition to Aviation Industry','D',3,'Aviation-Major','Discussions and exercises to improve communication and networking skills while increasing knowledge of student’s area of focus in the aviation industry. Topics include resume writing, interviewing, goal setting, report writing, presentation skills, public relations, and professional responsibilities. \r\n\r\nRequisites: AVN major or minor and (Jr or Sr)'),('CE Elective 1','Civil Engineering','Civil Engineering Electives','D',3,'CE-Elective','Choose from CE3310, CE3530, CE4100, CE4110, CE4150, CE4160, CE4170, CE4190, CE4240, CE4370, CE4450, CE4530, CE4540, CE4570, CE4580, CE4630, CE4710'),('CE Elective 2','Civil Engineering','Civil Engineering Electives','D',3,'CE-Elective','Choose from CE3310, CE3530, CE4100, CE4110, CE4150, CE4160, CE4170, CE4190, CE4240, CE4370, CE4450, CE4530, CE4540, CE4570, CE4580, CE4630, CE4710'),('CE Elective 3','Civil Engineering','Civil Engineering Electives','C',3,'CE-Elective','Choose from CE3310, CE3530, CE4100, CE4110, CE4150, CE4160, CE4170, CE4190, CE4240, CE4370, CE4450, CE4530, CE4540, CE4570, CE4580, CE4630, CE4710'),('CE Senior Design','Civil Engineering','Civil Engineering Senior Design','D',3,'CE-Capstone','Choose From CE4910, CE4911, CE4912, or CE4913'),('CE Tech Elective','Civil Engineering','Civil Engineering Technical Elective','D',3,'CE-Major','Choose from CHEM1520, CHEM3010, ET2100, ET2300, ET3200, ISE3200'),('CE2000','Civil Engineering','Civil Engineering Fundamentals','C',1,'CE-Major','Overview of civil engineering profession and specialization areas, value of professional organizations and lifelong learning, introduction to departmental facilities, description of curriculum, advising responsibilities, communication skills, basic design concept, and impact of civil engineering on society.'),('CE2010','Civil Engineering','Civil Engineering Computational Techniques','C',3,'CE-Major','Introduction to methods of problem solving, use of computers for calculations, applications or problem solving to civil engineering.'),('CE2100','Civil Engineering','Elements of Land Surveying','C',3,'CE-Major','Basic theory and field practice in measurement of distance, elevation, and angle; boundary surveying; introduction to GPS and photogrammetry. \r\n\r\nRequisites: ETM 2220'),('CE2160','Civil Engineering','Construction Engineering and Management','C',3,'CE-Major','Overview of construction engineering and management, project funding, bidding and selection process, design and construction interface, competitive and negotiated contracts, planning and scheduling, estimation, equipment, productivity and safety.'),('CE2220','Civil Engineering','Civil Engineering Graphics','C',2,'CE-Major','In this course, students will be introduced to basic Civil Engineering (CE) design concepts while learning AutoCAD. The class will introduce the basic features and some of the more advanced features of AutoCAD. After completing this course, a student should have sufficient knowledge and skills in AutoCAD to pass the AutoCAD certification as well as sufficient introduction to CE design to meet project requirements in other CE courses. 1 lec, 2 lab.\r\n\r\nRequisites: CE major'),('CE3110','Civil Engineering','Route Engineering','C',3,'CE-Major','Horizontal and vertical curves, geometric design of highways, and earth-work distribution.\r\n\r\nRequisites: CE 2100'),('CE3300','Civil Engineering','Structural Theory 1','C',3,'CE-Major','Determinacy requirements, analysis of statically determinate structures; influence lines, deflections, and introduction to analysis of statically indeterminate structures. \r\n\r\nRequisites: (CE 2010 or concurrent) and (C or better in ET 2220)'),('CE3400','Civil Engineering','Fluid Mechanics','C',3,'CE-Major','Statics and dynamics of viscous and nonviscous fluids, dimensional analysis and similitude, pipe flow, principles of lift and drag, and introduction to boundary layers. \r\n\r\nRequisites: C or better in ET 2240'),('CE3410','Civil Engineering','Hydraulics Laboratory','C',1,'CE-Major','Lab techniques , calibration principles, fluid and flow measurements, pipe network, and pump test. \r\n\r\nRequisites: CE 3420 or concurrent'),('CE3420','Civil Engineering','Applied Hydraulics and Hydrology','C',3,'CE-Major','Flow and pressure distribution in multi-loop networks, dynamics of flow in pumps and turbines, uniform and nonuniform flow in open channels, culvert hydraulics, hydrologic cycle, groundwater flow, surface flows, and water storage. \r\n\r\nRequisites: CE 3400 and (4000 or concurrent)'),('CE3610','Civil Engineering','Transportation Engineering','C',3,'CE-Major','Introduction to Transportation Engineering with emphasis on transportation planning concepts and multi-modal design elements.\r\n\r\nRequisites: CE 3110'),('CE3700','Civil Engineering','Geotechnical Engineering','C',4,'CE-Major','Soil compositions, physical and chemical properties, and classifications; water movement and seepage problems; consolidation and shear strength; applications to earth structures, retaining walls, slope stability, shallow & deep foundations, and soil erosion. \r\n\r\nRequisites: ET 2220 and GEOL 2830 and (CE 3400 or concurrent)'),('CE3710','Civil Engineering','Soil Engineering Lab','C',1,'CE-Major','Classification of soils and determination of their properties through tests; grain size analysis, Atterberg limits, relative density, Proctor testing, permeability, direct shear, consolidation, unconfined compression, and CBR test. \r\n\r\nRequisites: CE 3700 or concurrent'),('CE3800','Civil Engineering','Civil Engineering Materials','C',4,'CE-Major','Engineering properties of materials used in civil engineering applications including metals, concrete, timber, and composites. \r\n\r\nRequisites: ET 2220'),('CE4000','Civil Engineering','Societal Concerns in Civil Engineering','C',3,'CE-JuniorComposition','Engineering economics, statistics, ethics & professionalism (as related to civil engineering field). Emphasis will be placed on the preparation of economic justification reports, statistical reporting, and conclusion development and ethical position statements. 3 lec.\r\n\r\nRequisites: (ENG 1510 or 1610) and (Jr or Sr)'),('CE4280','Civil Engineering','Experimental Methods in Civil Engineering','C',3,'CE-Major','Application and theory of electronic sensors to civil engineering measurements including strain gages, load cells, displacement transducers, accelerometers, and temperature measurements. Analysis of errors in measured data. Emphasis will be also placed on the preparation of laboratory reports and a project report. 3 lec.\r\n\r\nRequisites: ET 2220 and PHYS 2052 and CE 4000'),('CE4320','Civil Engineering','Structural Design in Concrete','C',3,'CE-Major','Materials and properties; design methods, strength of rectangular sections subject to bending moments, axial loads, and shear forces either separately or in combination; continuity in concrete construction; design of one-way slabs; design of T sections in bending; deflection calculations, and footing design. \r\n\r\nRequisites: CE 2010 and 3300'),('CE4330','Civil Engineering','Structural Design in Steel','C',3,'CE-Major','Materials and properties; design methods, design of tension members; structural fasteners; design of compression members, beams, trusses, and frames. \r\n\r\nRequisites: CE 3300'),('CE4500','Civil Engineering','Water and Wastewater Engineering','D',4,'CE-Major','Sources and collection of public water supplies; principles of water treatment processes; quantities and collection of municipal wastewater; principles of wastewater treatment processes. \r\n\r\nRequisites: CE 3400 and CHEM 1510'),('CHEM1510-CE','Civil Engineering','Fundamentals of Chemistry','D',4,'CE-Major','General course in fundamental chemical principles. Atomic structure, periodic classification, bonding, mole concept, stoichiometry with problem solving, thermochemistry, equilibrium, and gases. Recommended for majors in chemistry, engineering, biological sciences, plant biology, clinical laboratory science, geological sciences, secondary education (B.S.Ed. in biological sciences, chemistry, physics, and integrated science), and preprofessional (biological science) areas. \r\n\r\nRequisites: (MATH 1200 or math placement level 2 or higher) and (C- or better in CHEM 1500 or score 34 or better on chemistry placement exam) and WARNING: not CHEM 1520 or 1210'),('CHEM1510-CPE','Computer Engineering','Fundamentals of Chemistry','D',4,'CPE-Major','General course in fundamental chemical principles. Atomic structure, periodic classification, bonding, mole concept, stoichiometry with problem solving, thermochemistry, equilibrium, and gases. Recommended for majors in chemistry, engineering, biological sciences, plant biology, clinical laboratory science, geological sciences, secondary education (B.S.Ed. in biological sciences, chemistry, physics, and integrated science), and preprofessional (biological science) areas. \r\n\r\nRequisites: (MATH 1200 or math placement level 2 or higher) and (C- or better in CHEM 1500 or score 34 or better on chemistry placement exam) and WARNING: not CHEM 1520 or 1210'),('CHEM1510-EE','Electrical Engineering','Fundamentals of Chemistry','D',4,'EE-Major','General course in fundamental chemical principles. Atomic structure, periodic classification, bonding, mole concept, stoichiometry with problem solving, thermochemistry, equilibrium, and gases. Recommended for majors in chemistry, engineering, biological sciences, plant biology, clinical laboratory science, geological sciences, secondary education (B.S.Ed. in biological sciences, chemistry, physics, and integrated science), and preprofessional (biological science) areas. \r\n\r\nRequisites: (MATH 1200 or math placement level 2 or higher) and (C- or better in CHEM 1500 or score 34 or better on chemistry placement exam) and WARNING: not CHEM 1520 or 1210'),('CPE EE/CS Elective 1','Computer Engineering','CPE Senior Elective','D',3,'CPE-Elective','Complete two of the following courses:\r\n\r\nCS 4000 - Introduction to Distributed, Parallel, and Web-Centric Computing Credit Hours: 3.0\r\nCS 4040 - Design and Analysis of Algorithms Credit Hours: 3.0\r\nCS 4060 - Computation Theory Credit Hours: 3.0\r\nCS 4100 - Introduction to Formal Languages and Compilers Credit Hours: 3.0\r\nCS 4160 - Problem Solving with Bioinformatics Tools Credit Hours: 3.0\r\nCS 4170 - Data Mining With Applications in the Life Sciences Credit Hours: 3.0\r\nCS 4250 - Interactive Computer Graphics Credit Hours: 3.0\r\nCS 4440 - Data Communications Credit Hours: 3.0\r\nCS 4500 - Advanced Object Oriented Design and GUI Techniques Credit Hours: 3.0\r\nCS 4580 - Operating Systems II Credit Hours: 3.0\r\nCS 4620 - Database Systems Credit Hours: 3.0\r\nCS 4750 - Internet Engineering Credit Hours: 4.0\r\nCS 4800 - Artificial Intelligence Credit Hours: 3.0\r\nEE 4053 - Physical and Power Electronics Credit Hours: 3.0\r\nEE 4143 - Design of Digital Circuits Credit Hours: 3.0\r\nEE 4183 - Micro and Nano Fabrication Credit Hours: 3.0\r\nEE 4213 - Feedback Control Theory Credit Hours: 3.0\r\nEE 4313 - Optoelectronics and Photonics Credit Hours: 3.0\r\nEE 4403 - Antenna and Microwave Theory Credit Hours: 3.0\r\nEE 4523 - Introduction to Electric Power System Engineering and Analysis Credit Hours: 3.0\r\nEE 4713 - Communication Engineering Credit Hours: 3.0\r\nEE 4853 - Electronic Navigation Systems Credit Hours: 3.0\r\nEE 4913 - Programmable Logic Controllers Credit Hours: 3.0')