Sciences Option\r\n\r\nComplete the following courses:\r\n\r\n \r\nBIOS 1700 - Biological Sciences I: Molecules and Cells Credit Hours: 3.0\r\nBIOS 1705 - Biological Sciences I Laboratory Credit Hours: 1.0'),('CPE Tech Elective 1','Computer Engineering','Computer Engineering Technical Elective','D',3,'CPE-Elective','Complete two courses (totaling at least 6 hours) from the following courses. No course can be used to satisfy two requirements.\r\n\r\nCE 3400\r\nCS 4***\r\nEE 4***\r\nET 2220\r\nET 2240\r\nET 2300\r\nET 3200\r\nMATH 4***\r\nME 3510\r\nMGT 2020'),('CPE Tech Elective 2','Computer Engineering','Computer Engineering Technical Elective','D',3,'CPE-Elective','Complete two courses (totaling at least 6 hours) from the following courses. No course can be used to satisfy two requirements.\r\n\r\nCE 3400\r\nCS 4***\r\nEE 4***\r\nET 2220\r\nET 2240\r\nET 2300\r\nET 3200\r\nMATH 4***\r\nME 3510\r\nMGT 2020'),('CS2400','Computer Science','Introduction to Computer Science','C+',4,'CS-Major',''),('CS2400-CPE','Computer Engineering','Introduction to Computer Science 1','C',4,'CPE-Major','Introduction to computer science, the discipline of computing, and the programming language C++. Topics include elementary C++, computer algorithms, loops and flow of control, procedural abstraction, functions, streams, arrays, strings, objects and classes, polymorphism and operator overloading, professional societies, professionalism and ethics, pointers, dynamic memory, and dynamic arrays. \r\n\r\nRequisites: MATH 1200 or math placement level 2 or higher'),('CS2401','Computer Science','Introduction to Computer Science 2','C+',3,'CS-Major',''),('CS2401-CPE','Computer Engineering','Introduction to Computer Science 2','C',4,'CPE-Major','Continuation of C S 2400 with emphasis on design of software and more advanced features of the objected oriented programming language C++. Topics include design of software using UML, generic programming (templates), linked lists, stacks, queues, container classes and iterators, inheritance, derived classes, virtual functions, tree data structures, and recursion. \r\n\r\nRequisites: CS 2400 and (MATH 1300 or 2301 or Math Placement Level 3)'),('CS2650','Computer Science','Professional and Ethical Aspects of Computing','D-',2,'CS-Major',''),('CS3000','Computer Science','Introduction to Discrete Structures','C+',4,'CS-Major',''),('CS3000-CPE','Computer Engineering','Discrete Structures','D',4,'CPE-Major','Discrete mathematics and its application to computer science explored. Foundational mathematical techniques used in computer science are explored in depth: propositional logic, number theory and proofs, sequences and mathematical induction, set theory, counting and combinatorics, discrete probability, functions, recursion, simple analysis of algorithms, and orderings and relations. Applications of these structures to various areas of computer science also covered.\r\n\r\nRequisites: CS 2400'),('CS3200','Computer Science','Organizaion of programming Languages','D-',3,'CS-Major',''),('CS3560','Computer Science','Software Engineering tools and Practices','D-',3,'CS-Major',''),('CS3560-CPE','Computer Engineering','Software Engineering tools and Practices','D',3,'CPE-Major','Covers current software engineering tools and practices. Topics include software architecture, integrated development environments, source code control systems, build and make systems, debuggers, static analysis tools, dynamic analysis tools, design tools, program verification, and design patterns. Experiences in multiple environments (Windows and a UNIX-based environment, i.e., MAC OS, Linux, or Solaris).\r\n\r\nRequisites: CS 2401'),('CS3610','Computer Science','Data Structures','C+',4,'CS-Major',''),('CS3610-CPE','Computer Engineering','Data Structures','D',4,'CPE-Major','Various data structures, algorithms associated with data structures, and analysis of algorithms are explored. Topics include analysis of algorithms, dynamic arrays, tree structures, heaps, balanced trees, dictionaries, graphs and graph algorithms, and the complexity of sorting. Graph algorithms for depth first and breadth first search, shortest path, minimum cost spanning trees, and others are covered. Coverage of built in data structures and algorithms in modern programming languages included. \r\n\r\nRequisites: (CS 3000 or MATH 3050) and C or better in CS 2401'),('CS4000','Computer Science','Introductio to Parallel, Distributed and Web Centric Computing','D-',3,'CS-Major',''),('CS4040','Computer Science','Algorithm Analysis and Design','D-',3,'CS-Major',''),('CS4060-E','Computer Science','Computation Theory','D-',3,'CS-Elective',''),('CS4100','Computer Science','Introduction to Formal Languages and Compilers','D-',3,'CS-Major',''),('CS4250-E','Computer Science','Computer Graphics','D-',3,'CS-Elective',''),('CS4420','Computer Science','Software Design and Development 1','D-',3,'CS-Major',''),('CS4420-CPE','Computer Engineering','Operating Systems','D',3,'CPE-Major','In-depth coverage of computer operating systems and related computer architecture issues. Coverage of physical devices, interrupts, and communication between the computer and external hardware. Interfaces between user programs and the operating system, system calls, software interrupts, and protection issues. Context switching, process address spaces, and process scheduling. Process synchronization, interprocess communications, critical sections, and deadlock detection and recovery. Memory mapping, swapping, paging, and virtual memory.\r\n\r\nRequisites: CS 3610 and EE 3613 and 3954 or CS 361 and EE 395A'),('CS4560','Computer Science','Software Design and Development 1','D-',3,'CS-Major',''),('CS4561','Computer Science','Software Design and Development 2','D-',3,'CS-Major',''),('CS4580-E','Computer Science','Operating Systems 2','D-',3,'CS-Elective',''),('CS4620-E','Computer Science','Database Systems','D-',3,'CS-Elective',''),('ECON1010-AVN','Aviation and Flight','Principles of Microeconomics','C+',3,'GenEd','Basic theory and economic analysis of prices, markets, production, wages, interest, rent, and profits. Analysis of how the capitalistic system determines what, how, and for whom to produce.'),('EE Engineering Elective 1','Electrical Engineering','Electrical Engineering Engineering Electives','D',3,'EE-Elective','Complete two of the following courses:\r\n\r\n \r\nCE 3400 - Fluid Mechanics Credit Hours: 3.0\r\nET 2200 - Statics Credit Hours: 3.0\r\nET 2220 - Strength of Materials Credit Hours: 3.0\r\nET 2240 - Dynamics Credit Hours: 3.0\r\nET 2300 - Principles of Engineering Materials Credit Hours: 3.0\r\nET 3200 - Engineering Thermodynamics Credit Hours: 3.0'),('EE Engineering Elective 2','Electrical Engineering','Electrical Engineering Engineering Electives','D',3,'EE-Elective','Complete two of the following courses:\r\n\r\n \r\nCE 3400 - Fluid Mechanics Credit Hours: 3.0\r\nET 2200 - Statics Credit Hours: 3.0\r\nET 2220 - Strength of Materials Credit Hours: 3.0\r\nET 2240 - Dynamics Credit Hours: 3.0\r\nET 2300 - Principles of Engineering Materials Credit Hours: 3.0\r\nET 3200 - Engineering Thermodynamics Credit Hours: 3.0'),('EE Programming Elective','Electrical Engineering','Electrical Engineering Programming Electives','D',3,'EE-Elective','Complete one of the following couses:\r\n\r\nCS 2300 - Computer Programming in JAVA Credit Hours: 4.0\r\nCS 2401 - Introduction to Computer Science II Credit Hours: 4.0'),('EE Science Elective','Electrical Engineering','Electrical Engineering Science Electives','D',4,'EE-Elective','Complete 4 hours of science with lab. Complete one course from the following categories:\r\n\r\nBiological Sciences Option\r\n\r\nComplete the following courses:\r\n\r\nBIOS 1700 - Biological Sciences I: Molecules and Cells Credit Hours: 3.0\r\nBIOS 1705 - Biological Sciences I Laboratory Credit Hours: 1.0\r\n\r\nPhysics Option\r\n\r\nComplete any PHYS course with lab higher than PHYS 2502.\r\n\r\nChemistry Option\r\