ctives','D',3,'EE-Elective','Complete two courses (minimum 6 credit hours) from the following. No course can be used to satisfy two requirements.\r\n\r\nEE4***, \r\nCS 4***, \r\nMATH 4***, \r\nMGT 2020,\r\nME 3510, \r\nCE 3400, \r\nET 2240,\r\nET 3200\r\nET 2300\r\nET 2220'),('EE Tech Elective 2','Electrical Engineering','Electrical Engineering Technical Electives','D',3,'EE-Elective','Complete two courses (minimum 6 credit hours) from the following. No course can be used to satisfy two requirements.\r\n\r\nEE4***, \r\nCS 4***, \r\nMATH 4***, \r\nMGT 2020,\r\nME 3510, \r\nCE 3400, \r\nET 2240,'),('EE1014','Electrical Engineering','Introduction to Electrical Engineering','C',3,'EE-Major','Introduction to the profession of electrical engineering. Develops a knowledge of key technical concepts of electricity: voltage, current, resistance, and power. Explores the history, professional values, and methods of electrical engineering. Lab work provides hands-on experience with electrical systems. Introduction to MATLAB®. \r\n\r\nRequisites: MATH 1200 or above or math placement level 2 or higher'),('EE1014-CPE','Computer Engineering','Introduction to Electrical Engineering','C',4,'CPE-Major',''),('EE1024-CPE','Computer Engineering','Introduction to Computer Engineering','D',4,'CPE-Major','Introduction to the field of computer engineering. Develops a knowledge of the fundamentals of Boolean algebra, binary arithmetic, characteristics of logic gates, and flip-flops. Lab work provides hands-on experience with digital systems. \r\n\r\nRequisites: MATH 1200 or math placement level 2 or higher'),('EE1024-CS','Computer Science','Introduction To computer engineering','C+',4,'CS-Major',''),('EE1024-EE','Electrical Engineering','Introduction to Computer Engineering','C',4,'EE-Major','Introduction to the field of computer engineering. Develops a knowledge of the fundamentals of Boolean algebra, binary arithmetic, characteristics of logic gates, and flip-flops. Lab work provides hands-on experience with digital systems. \r\n\r\nRequisites: MATH 1200 or math placement level 2 or higher'),('EE2104','Electrical Engineering','Circuits 1','C',4,'EE-Major','DC circuit analysis, Kirchhoff’s laws, nodal and mesh analysis, circuit theorems, operational amplifiers, inductance and capacitance, first-order RC and RL circuits, second-order RLC circuits, transient response analysis, and AC circuit analysis using phasors.\r\n\r\nRequisites: (EE 101 or 1014) and (MATH 2301 or concurrent)'),('EE2104-CPE','Computer Engineering','Circuits 1','C',4,'CPE-Major','DC circuit analysis, Kirchhoff’s laws, nodal and mesh analysis, circuit theorems, operational amplifiers, inductance and capacitance, first-order RC and RL circuits, second-order RLC circuits, transient response analysis, and AC circuit analysis using phasors.\r\n\r\nRequisites: (EE 101 or 1014) and (MATH 2301 or concurrent)'),('EE2114','Electrical Engineering','Circuits 2','C',4,'EE-Major','Continuation of EE 2104. AC power analysis, three-phase circuits, magnetically coupled circuits and transformers, frequency response, passive and active filters, and circuit analysis using the Laplace transform. Includes a laboratory. \r\n\r\nRequisites: C or better in EE 2104 and EE 2213'),('EE2114-CPE','Computer Engineering','Circuits 2','C',4,'CPE-Major','Continuation of EE 2104. AC power analysis, three-phase circuits, magnetically coupled circuits and transformers, frequency response, passive and active filters, and circuit analysis using the Laplace transform. Includes a laboratory. \r\n\r\nRequisites: C or better in EE 2104 and EE 2213'),('EE2213','Electrical Engineering','Instrumentation Lab','C',3,'EE-Major','Introduction to electrical instruments and measurement techniques. Emphasis on electrical characteristic, limitations, and proper use of electrical laboratory equipment. Safety in operation and experimental procedures covered. Emphasis also placed on the proper acquisition, recording, analysis, and reporting of data. Format iincludes classroom instruction and laboratory work.\r\n\r\nRequisites: EE 2104 or concurrent'),('EE2324','Electrical Engineering','Analytical Foundations of Electrical Engineering','C',4,'EE-Major','Vector analysis with applications to electromagnetic fields. Matrix theory with applications to state variable formulation of linear and non-linear systems. Complex variable theory with applications to systems in preparation for Laplace transforms. Analysis of ordinary differential equations. Special analytical techniques for the solution of complex engineering problems utilizing computer-oriented techniques.\r\n\r\nRequisites: (CS 210 or 240A or 2400) and (EE 101 or 1014) and MATH 2302'),('EE2324-CPE','Computer Engineering','Analytical Foundations of Electrical Engineering','D',4,'CPE-Major','Vector analysis with applications to electromagnetic fields. Matrix theory with applications to state variable formulation of linear and non-linear systems. Complex variable theory with applications to systems in preparation for Laplace transforms. Analysis of ordinary differential equations. Special analytical techniques for the solution of complex engineering problems utilizing computer-oriented techniques.\r\n\r\nRequisites: (CS 210 or 240A or 2400) and (EE 101 or 1014) and MATH 2302'),('EE3214','Electrical Engineering','Electromagnetics and Materials 1','C',3,'EE-Major','Explores Maxwell’s equations through an overview of properties of materials, electrostatics, magnetostatics and electrostatics, and magnetostatics and electrodynamics.\r\n\r\nRequisites: EE 2324 or MATH 440'),('EE3214-CPE','Computer Engineering','Electromagnetics and Materials 1','C',4,'CPE-Major','Explores Maxwell’s equations through an overview of properties of materials, electrostatics, magnetostatics and electrostatics, and magnetostatics and electrodynamics.\r\n\r\nRequisites: EE 2324 or MATH 440'),('EE3223','Electrical Engineering','Electromagnetics and Materials 2','C',3,'EE-Major',''),('EE3313-CPE','Computer Engineering','Instrumentation Lab','D',3,'CPE-Major','Introduction to electrical instruments and measurement techniques. Emphasis on electrical characteristic, limitations, and proper use of electrical laboratory equipment. Safety in operation and experimental procedures covered. Emphasis also placed on the proper acquisition, recording, analysis, and reporting of data. Format iincludes classroom instruction and laboratory work.\r\n\r\nRequisites: EE 2104 or concurrent'),('EE3334','Electrical Engineering','Linear Signals and Systems','C',4,'EE-Major','Develop an understanding of the relationship between signals and systems. Methods for the analysis of continuous-time signals and linear time-invariant systems will be covered in depth. Includes concepts of convolution, Fourier series and Fourier transform, and Laplace transform, with applications in analysis and design of frequency selective filters, communication and control systems. Also develop an awareness of discrete time signals and systems, and an awareness of state space representations of linear systems.\r\n\r\nRequisites: EE 2114 and EE 2324'),('EE3343','Electrical Engineering','Electronics 1','C',3,'EE-Major','Develop an understanding of electronic devices including diodes, biopolar transistors, and FETs. Develop an awareness of digital electronics, complementary MOS logic design and bipolar logic circuits. Small-signal modeling and linear amplification also covered. Includes computer-aided analysis and design.\r\n\r\nRequisites: EE 2324 or MATH 440'),('EE3343-CPE','Computer Engineering','Electronics 1','C',3,'CPE-Major','Develop an understanding of electronic devices including diodes, biopolar transistors, and FETs. Develop an awareness of digital electronics, complementary MOS logic design and bipolar logic circuits. Small-signal modeling and linear amplification also covered. Includes computer-aided analysis and design.\r\n\r\nRequisites: EE 2324 or MATH 440'),('EE3513','Electrical Engineering','Digital Signals and Systems','C',3,'EE-Major','Introduction to discrete-time signals and systems including convolution, z-transforms and frequency response.\r\n\r\nRequisites: EE2324 or EE2114'),('EE3513-CPE','Computer Engineering','Digital Signals and Systems-CPE','C',3,'CPE-Major','Introduction to discrete-time signals and systems including convolution, z-transforms and frequency response.\r\n\r\nRequisites: EE2324 or EE2114'),('EE3613','Computer Engineering','Computer Organization','D',3,'CPE-Major','Computer organization and architecture with emphasis in the design of single and multicore architectures; quantitative cost, performance-power trade-offs, Amdahl’s Law, instruction set architecture (RISC), assembly language programming, number representations, adders and simple ALUs, integer and floating point computer arithmetic, single and multi-cycle implementation of control and data-path design, pipelining with hazard detection, memory hierarchy and memory management, cache and virtual memory, and I/O devices. Term paper/project involving computer hardware design and system simulation required. \r\n\r\nRequisites: (CS 2400 or 240A) and (EE 1024 or 102)'),('EE3613-CS','Computer Science','Computer Organization','C+',3,'CS-Major',''),('EE3713','Electrical Engineering','Probobility and Statistics for electrical Engineers','D',3,'EE-Major','Fundamentals of statistics and probability and the ability to apply them to problems in electrical engineering.\r\n\r\nRequisites: MATH 2302'),('EE3713-CPE','Computer Engineering','Probobility and Statistics for electrical Engineers','D',3,'CPE-Major',''),('EE3713-CS','Computer Science','Applied Probability and Statistics for Electrical Engineers','D-',3,'CS-Major',''),('EE3753-CPE','Computer Engineering','Introduction to Computer Networks','D',3,'CPE-Major','Computer networks with an emphasis on the design and working of Internet, protocol layers, service models, HTTP, FTP, electronic mail, UDP, TCP, congestion control, hierarchical routing, internet protocol (IP), IPv4, IPv6, data link layer, error correction and detection, multiple access protocols, Ethernet, bridges, hubs, wireless link, PPP, ATM, multimedia over IP, and basic security such as encryption, authentication and firewalls.\r\n\r\nRequisites: EE 2324 or MATH 340'),('EE3954','Computer Engineering','Microcontrollers and Microprocessors','D',4,'CPE-Major','Introduction to microcontrollers and their architecture; assembly language; timing analysis of assembly language programs; digital input/output (I/O); in-depth discussion on the use of built-in peripheral devices such as timers, analog-to-digital converters, EEPROM storage devices, capture/compare/PWM, and parallel and serial communication devices; serial communication includes both synchronous communication (SPI, I2C) and asynchronous (USART) communication; introduction to systems of networked microcontrollers; advanced fixed-point arithmetic on a microcontroller.\r\n\r\nRequisites: (CS 210 or 240A or 2400) and (EE 1024 or 102)'),('EE3954-CS','Computer Science','Microprocessors','D-',4,'CS-Major',''),('EE3954-EE','Electrical Engineering','Microcontrollers and Microprocessors','D',4,'EE-Major','Introduction to microcontrollers and their architecture; assembly language; timing analysis of assembly language programs; digital input/output (I/O); in-depth discussion on the use of built-in peripheral devices such as timers, analog-to-digital converters, EEPROM storage devices, capture/compare/PWM, and parallel and serial communication devices; serial communication includes both synchronous communication (SPI, I2C) and asynchronous (USART) communication; introduction to systems of networked microcontrollers; advanced fixed-point arithmetic on a microcontroller.\r\n\r\nRequisites: (CS 210 or 240A or 2400) and (EE 1024 or 102)'),('EE3963','Electrical Engineering','Electric Machines','D',3,'EE-Major','Basic principles of electromechanical machines. Circuit models and parameter tests for single-phase and 3-phase transformers. Fundamentals of DC machinery; circuit models and characteristics of DC motors. Fundamentals of AC machinery; theory and operation of synchronous machines and induction motors.\r\n\r\nRequisites: EE 2114 or ET 3132'),('EE3973','Electrical Engineering','Electronics 2','C',3,'EE-Major','Continuation of EE 3343. Semiconductor devices. AC-coupled amplifiers. Feedback. Differential amplifiers. Oscillators. Power devices.\r\n\r\nRequisites: EE 3343'),('EE4673','Computer Engineering','Embedded Systems','D',3,'CPE-Major','Introduction and history of embedded systems; defining embedded system using requirements; embedded system processors including microcontrollers, low-power microprocessors, digital signal processors and Field Programmable Gate Arrays (FPGA); distributed embedded systems; timing aspects of embedded systems; real-time operation and real-time operating systems as applied to embedded systems; the economy of embedded systems; fault tolerance; communication protocols overview and more detailed description of the Controller Area Network (CAN) and Time-Triggered Protocol (TTP) as well as some wireless networks used in wireless sensor networks; defining interfaces and the use of mixed-signal systems (digital and analog); design methodologies and tools. \r\n\r\nRequisites: EE 3954EE 395A or 3954'),('EE4673-CPE','Computer Engineering','Embedded Systems','D',3,'CPE-Major','Introduction and history of embedded systems; defining embedded system using requirements; embedded system processors including microcontrollers, low-power microprocessors, digital signal processors and Field Programmable Gate Arrays (FPGA); distributed embedded systems; timing aspects of embedded systems; real-time operation and real-time operating systems as applied to embedded systems; the economy of embedded systems; fault tolerance; communication protocols overview and more detailed description of the Controller Area Network (CAN) and Time-Triggered Protocol (TTP) as well as some wireless networks used in wireless sensor networks; defining interfaces and the use of mixed-signal systems (digital and analog); design methodologies and tools. \r\n\r\nRequisites: EE 3954EE 395A or 3954'),('EE4683','Computer Engineering','Computer Architecture','D',3,'CPE-Major','Emphasis on the design of advanced architectural concepts for multicores; performance trade-offs for multicores, advanced pipelining, superscalar and dynamic scheduling, limits of instruction level parallelism, multithreading and multicores, multi-level caching, virtual memory, I/O fundamentals and techniques, classification of parallel machines, shared memory multiprocessors, cache coherence, interconnection networks and clusters. Term paper/project involving computer hardware design and system simulation required.\r\n\r\nRequisites: EE 3613'),('EE4683-CPE','Computer Engineering','Computer Architecture','D',3,'CPE-Major','Emphasis on the design of advanced architectural concepts for multicores; performance trade-offs for multicores, advanced pipelining, superscalar and dynamic scheduling, limits of instruction level parallelism, multithreading and multicores, multi-level caching, virtual memory, I/O fundamentals and techniques, classification of parallel machines, shared memory multiprocessors, cache coherence, interconnection networks and clusters. Term paper/project involving computer hardware design and system simulation required.\r\n\r\nRequisites: EE 3613'),('EE4953','Electrical Engineering','Electrical and Computer Engineering Capstone 1','D',3,'EE-Capstone','Provides students the opportunity to refine and demonstrate their ability in engineering design. Major design team project developed emphasizing problem definition and specification. Preliminary design review conducted. Examines systems approach to problem solving, engineering ethics, economic analysis, and the elements of scheduling and planning. \r\n\r\nRequisites: 33 Hours in EE'),('EE4953-CPE','Computer Engineering','Electrical and Computer Engineering Capstone 1','D',3,'CPE-Major','Provides students the opportunity to refine and demonstrate their ability in engineering design. Major design team project developed emphasizing problem definition and specification. Preliminary design review conducted. Examines systems approach to problem solving, engineering ethics, economic analysis, and the elements of scheduling and planning. \r\n\r\nRequisites: 33 Hours in EE'),('EE4963','Electrical Engineering','Electrical and Computer Engineering Capstone 2','D',3,'EE-Capstone','Continuation of team design project begun in EE 4953 with an emphasis on construction, pre-testing, and redesign; then ultimately final design assembly, testing, and analysis of outcomes. Critical design and formal design reviews conducted. Exposure to a variety of career options. Examine and develop skills necessary for a successful engineering career.\r\n\r\nCredit Hours: 3.0'),('EE4963-CPE','Computer Engineering','Electrical and Computer Engineering Capstone 2','D',3,'CPE-Major','Continuation of team design project begun in EE 4953 with an emphasis on construction, pre-testing, and redesign; then ultimately final design assembly, testing, and analysis of outcomes. Critical design and formal design reviews conducted. Exposure to a variety of career options. Examine and develop skills necessary for a successful engineering career.\r\n\r\nCredit Hours: 3.0'),('ENG1510-AVN','Aviation and Flight','Writing and Rhetoric 1','C',3,'GenEd','Practice in composing and revising expository essays that are well organized, logically coherent, and effective for their purpose and audience. Topics from personal experience, nonfiction reading, and research material.'),('ET2200-CE','Civil Engineering','Statics','D',3,'CE-Major','Laws of equilibrium of forces, friction, centroids, and moment of inertia. \r\n\r\nRequisites: MATH 2302 and PHYS 2051'),('ET2220-CE','Civil Engineering','Strenght of Materials','C',3,'CE-Major','Simple stresses and strains, bending, torsion, beam deflection, columns, and combined stresses. \r\n\r\nRequisites: C or better in ET 2200'),('ET2240-CE','Civil Engineering','Dynamics','C',3,'CE-Major','Motion of particles and rigid bodies, work and energy, impulse and momentum. \r\n\r\nRequisites: PHYS 2051 and (C or better in ET 2200)'),('GEOG1310-AVN','Aviation and Flight','Globalization and the Developing World','C',3,'GenEd','Survey of globalization and its impact on development, international relations, environment and culture in developing countries around the world.'),('GEOL2830-CE','Civil Engineering','Geology for Engineers','D',4,'CE-Major','Geologic principles applied to engineering projects and materials. \r\n\r\nRequisites: WARNING: No credit for this course if taken after the following: GEOL 1010\r\nCredit Hours: 4.0'),('Lab Science Sequence','Computer Science','Various Lab Sequnces','C+',8,'CS-Major','Choices are Chem 1510 and 1520, BIOS 1700 and 1710, Physics 2051 and 2052, and PBIO 1140 and 1150'),('MATH2301-CE','Civil Engineering','Calculus 1','C',4,'CE-Major','First course in calculus and analytic geometry with applications in the sciences and engineering. Includes basic techniques of differentiation and integration with applications including rates of change, optimization problems, and curve sketching; includes exponential, logarithmic and trigonometric functions. No credit for both MATH 2301 and 1350 (always keep 2301).\r\n\r\nRequisites: (A in 163A) or (B or better in MATH 1350) or (C or better in 1300 or 1322) or (Math placement level 3)'),('MATH2301-CPE','Computer Engineering','Calculus 1','C',4,'CPE-Major',''),('MATH2301-CS','Computer Science','Calculus-1','C+',4,'CS-Major',''),('MATH2301-EE','Electrical Engineering','Calculus 1','C',4,'EE-Major','First course in calculus and analytic geometry with applications in the sciences and engineering. Includes basic techniques of differentiation and integration with applications including rates of change, optimization problems, and curve sketching; includes exponential, logarithmic and trigonometric functions. No credit for both MATH 2301 and 1350 (always keep 2301).\r\n\r\nRequisites: (A in 163A) or (B or better in MATH 1350) or (C or better in 1300 or 1322) or (Math placement level 3)'),('MATH2302-CE','Civil Engineering','Calculus 2','C',4,'CE-Major','Second course in calculus and analytic geometry with applications in the sciences and engineering. Includes techniques of integration, conic sections, polar coordinates, infinite series, vectors and vector operations.\r\n\r\nRequisites: C or better in MATH 2301 or 263B'),('MATH2302-CPE','Computer Engineering','Calculus 2','D',4,'CPE-Major',''),('MATH2302-CS','Computer Science','Calculus-1','D-',4,'CS-Major',''),('MATH2302-EE','Electrical Engineering','Calculus 2','C',4,'EE-Major','Second course in calculus and analytic geometry with applications in the sciences and engineering. Includes techniques of integration, conic sections, polar coordinates, infinite series, vectors and vector operations.\r\n\r\nRequisites: C or better in MATH 2301 or 263B'),('MATH3200-CE','Civil Engineering','Applied Linear Algebra','D',3,'CE-Major','A course on linear algebra with an emphasis on applications and computations. Solutions to linear systems, matrices and matrix algebra, determinants, n-dimensional real vector spaces and subspaces, bases and dimension, eigenvalues and eigenvectors, diagonalization, norms, inner product spaces, orthogonality and least squares problems. No credit for both this course and MATH 3210 (first taken deducted).\r\n\r\nRequisites: (MATH 163A or 263A or 1350 or 2301) and WARNING: No credit for both this course and MATH 3210 (first course taken deducted)'),('MATH3200-CS','Computer Science','Linear Algebra','D-',3,'CS-Major',''),('MATH3300-EE','Electrical Engineering','Calculus 3','D',4,'EE-Major','Third course in calculus and analytic geometry with applications in the sciences and engineering. Includes partial differentiation, multiple integrals, line and surface integrals, and the integral theorems of vector calculus. \r\n\r\nRequisites: C or better in MATH 2302'),('MATH3400-CE','Civil Engineering','Elementary Differential Equations','D',3,'CE-Major','Introduction to ordinary differential equations and their use as models for applications with an emphasis on exact solution methods for linear equations and systems including Laplace transform methods. \r\n\r\nRequisites: C or better in MATH 2302'),('PHYS2051-CE','Civil Engineering','General Physics','C',5,'CE-Major','Classical physics with calculus and vectors. Newtonian mechanics, rotational dynamics, gravitation, oscillations, fluids, thermodynamics.\r\n\r\nRequisites: MATH 263A or 266A or 266B or (2301 or concurrent)'),('PHYS2051-CPE','Computer Engineering','General Physics','D',5,'CPE-Major',''),('PHYS2051-EE','Electrical Engineering','General Physics','D',5,'EE-Major','Classical physics with calculus and vectors. Newtonian mechanics, rotational dynamics, gravitation, oscillations, fluids, thermodynamics.\r\n\r\nRequisites: MATH 263A or 266A or 266B or (2301 or concurrent)'),('PHYS2052-CE','Civil Engineering','General Physics','D',5,'CE-Major','Classical physics with calculus and vectors. wave mechanics and phenomena, electrostatics, capacitance, electric current and circuits, magnetism and magnetic fields, electric induction, A.C. circuits, electromagnetic waves, geometrical optics, interference, and diffraction of light.\r\n\r\nRequisites: (MATH 2301 or 263A or 263B or 266A or 266B) and PHYS 2051');
