INSERT INTO `advisingApp_degrees` VALUES ('Aviation Flight','The aviation flight program is a Federal Aviation Administration (FAA) approved FAR 141 program that meets the federal regulations for pilot training schools. Specifically, the flight program educates and prepares students for a variety of pilot-related positions, including professional flight instructor, commercial pilot, airline pilot, and corporate pilot positions. Flight training is completed in university-owned aircraft.',120,5),('Chemical Engineering','The Department of Chemical and Biomolecular Engineering offers an accredited B.S. in chemical engineering.  The undergraduate program’s objectives are for graduates to gain a strong foundation in chemical engineering theory and practice, have communication and interpersonal skills needed to succeed in a professional environment, and have the ability to become scholars and professionals dedicated to the betterment of themselves and society.\r\n\r\nUndergraduate study begins with foundation courses in chemistry, biology, physics, and mathematics.  Individual and team projects are introduced early and continue throughout the curriculum, providing professional development through teamwork, communication skills and the ability to solve problems beyond the textbook. Students progress from basic analysis of commercial chemical and biological processes to operating pilot-scale manufacturing equipment and designing a complete manufacturing process.\r\n\r\nIn addition to their core requirements, students select from a wide range of technical elective courses in engineering, science and mathematics, giving the degree a strong interdisciplinary flavor. Student opting for the general track can choose electives from the full breadth of subject areas.  Students with a specific interest in focusing their technical electives may consider one of the tracks offered within the B.S. ChE degree,  These are the Chemical Engineering - Materials Track (BS7262), Chemical Engineering - Biological Track (BS7263), or the Chemical Engineering - Energy & the Environment Track (BS7264).',120,4),('Civil Engineering','Civil engineering evolved as a formal discipline at the start of the 19th century as a response to society’s needs for increased mobility and convenience. Today’s civil engineers deal primarily with public and private infrastructure and its relation to the environment, which includes planning, design, construction, and maintenance of transportation systems, bridges, dams, buildings, water supply/distribution/treatment systems, wastewater and storm water collection/treatment/disposal systems, irrigation systems, and flood control. Civil engineers also operate public and private works, and design environmental protection for water, air, and land.',120,2),('Computer Engineering','The electrical engineering program offers two curriculum tracks leading to a B.S.E.E. degree. The electrical engineering (EE) track is intended for students who want to work in one of the many areas of electrical engineering. A computer engineering (CpE) track is available for students who intend to work in the area of computers. Students who are undecided as to which area they want to pursue should follow the electrical engineering track until they decide.',120,1),('Computer Science','cool stuff',120,1),('Electrical Engineering','The electrical engineering program offers two curriculum tracks leading to a B.S.E.E. degree. The electrical engineering (EE) track is intended for students who want to work in one of the many areas of electrical engineering. A computer engineering (CpE) track is available for students who intend to work in the area of computers. Students who are undecided as to which area they want to pursue should follow the electrical engineering track until they decide.',120,1),('Engineering Technology and Management','The Bachelor of Science in Engineering Technology and Management combines technical courses, with a business minor, quantitative sciences, natural sciences, and general education to prepare graduates for technical, management, and/or applied engineering positions in business and industry. The engineering technology and management program is accredited by the Association of Technology Management and Applied Engineering (for more information see www.atmae.org).\r\n\r\nOver 90% of the engineering technology and management courses include lab activities in which students apply the theory they learned in the classroom to “real life” problems and projects. These activities are not simply simulation; they have real outcomes as well as consequences. This activity based, “hands on”, approach to learning provides students technical knowledge as well as continuously improving their problem solving skills.\r\n\r\nThe engineering technology and management graduate is a technical generalist who is competent in assessing problems and proposing solutions to improve productivity related to product specifications, materials and processes, industrial control and information systems, and operations management.',120,3),('Industrial and Systems Engineering','Industrial and systems engineers obtain a broad technical background with special attention to productivity, costs, quality, and the human factor in production and other systems. The systems to which industrial engineering techniques can be applied are quite diverse. Typically, industrial engineers have worked in manufacturing systems, but the methods have found applications in many other systems, including distribution centers, information systems, hospitals, transportation networks, and financial systems.',120,7),('Mechanical Engineering','Ohio University’s Mechanical Engineering major program has four educational objectives:\r\n\r\nPrepare graduates for engineering careers and advanced education\r\nGraduate mechanical engineers with technical skills\r\nGraduate mechanical engineers with skills to perform in the work environment\r\nGraduate mechanical engineers who are informed and aware of contemporary issues and the impact of engineering on society.\r\nMechanical engineering is an extremely diverse profession that is concerned with\r\n\r\nthe economical and ecological conversion of energy from natural sources to provide power, heating, cooling, and propulsion\r\nthe design of all types of machines, engines, and vehicles\r\nthe processing of materials into useful products\r\nthe development of systems for using machines and resources.\r\nProfessional activities include research, development, design, testing, production, operation and maintenance, marketing and sales, technical management, and administration.\r\nThe mechanical engineering curriculum is designed to provide a solid foundation in higher mathematics and basic sciences followed by extensive instruction in all of the classical mechanical engineering disciplines. Design and project experiences dealing with real engineering problems are integrated into the curriculum to help students:\r\n\r\napply their own creativity in formulating alternative engineering solutions\r\ndevelop an ability to work independently and/or in teams, which is an important skill for continued growth as a practicing engineer\r\nbridge the gap between the acquisition of engineering knowledge in required courses and the application of that knowledge to solve engineering problems.',120,6);
